const PIXELS_TO_POINTS_RATIO = 0.75;

export class XYLocation {
    x: number;
    y: number;
    constructor(x: number, y: number) {
        this.x = x;
        this.y = y;
    }
}

export class SheetOutlineOptions {
    outlineLocation: XYLocation;
    outlineColor: RGB;
    outlineScale: number;

    constructor(outlineLocation: XYLocation, outlineColor: RGB, outlineScale: number = 1.0) {
        this.outlineLocation = outlineLocation;
        this.outlineColor = outlineColor;
        this.outlineScale = outlineScale;
    }
}

class SpaceframeOutlineHelper {

    draw(pdf: PDFDocument, options: SheetOutlineOptions, spaceframe?: SpaceframeViewModel, serviceYear?: number, onlyModern: boolean = false) {
        if (spaceframe) {
            const outline = this.getOutline(spaceframe, serviceYear);
            if (outline) {
                this.drawOutline(pdf, outline, options);
            } else if (spaceframe.outline && !onlyModern) {
                this.drawOutline(pdf, spaceframe.outline, new SheetOutlineOptions(new XYLocation(0.0, 0.0), options.outlineColor));
            } else {
                this.drawOutline(pdf, this.isPreTngEra(serviceYear) ? CONSTITUTION_TOS_ERA_OUTLINE : GALAXY_CLASS_OUTLINE, options);
            }
        } else {
            this.drawOutline(pdf, this.isPreTngEra(serviceYear) ? CONSTITUTION_TOS_ERA_OUTLINE : GALAXY_CLASS_OUTLINE, options);
        }
    }

    getOutline(spaceframe?: SpaceframeViewModel, serviceYear?: number) {
        if (spaceframe.id == null) {
            if (this.nameIsLike(spaceframe.name, "Antares Class")) {
                return ANTARES_CLASS_OUTLINE;
            } else if (this.nameIsLike(spaceframe.name, "Ares Class")) {
                return ARES_CLASS_OUTLINE;
            } else if (this.nameIsLike(spaceframe.name, "Archer Class")) {
                return ARCHER_CLASS_OUTLINE;
            } else if (this.nameIsLike(spaceframe.name, "Integrity Class")) {
                return INTEGRITY_CLASS_OUTLINE;
            } else if (this.nameIsLike(spaceframe.name, "Loknar Class")) {
                return this.isMovieEra(serviceYear) ? LOKNAR_MOVIE_ERA_OUTLINE : LOKNAR_TOS_ERA_OUTLINE;
            } else if (this.nameIsLike(spaceframe.name, "Miranda Class")) {
                return this.isMovieEra(serviceYear) ? MIRANDA_MOVIE_ERA : MIRANDA_TOS_ERA;
            } else if (this.nameIsLike(spaceframe.name, "Parliament Class")) {
                return PARLIAMENT_CLASS_OUTLINE;
            } else if (this.nameIsLike(spaceframe.name, "Ross Class")) {
                return ROSS_CLASS_OUTLINE;
            } else if (this.nameIsLike(spaceframe.name, "D4 Class")) {
                return D4_CLASS_OUTLINE;
            } else {
                return GALAXY_CLASS_OUTLINE;
            }
        } else if (spaceframe.id === Spaceframe.Akira) {
            return AKIRA_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.Ambassador) {
            return AMBASSADOR_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.Centaur) {
            return CENTAUR_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.Constitution) {
            return this.isMovieEra(serviceYear) ? CONSTITUTION_MOVIE_ERA_OUTLINE : CONSTITUTION_TOS_ERA_OUTLINE;
        } else if (spaceframe.id === Spaceframe.Miranda) {
            return this.isMovieEra(serviceYear) ? MIRANDA_MOVIE_ERA : MIRANDA_TOS_ERA;
        } else if (spaceframe.id === Spaceframe.Daedalus) {
            return DAEDALUS_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.Excelsior) {
            return EXCELSIOR_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.Oberth) {
            return OBERTH_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.Galaxy) {
            return GALAXY_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.Hermes) {
            return HERMES_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.Nova) {
            return NOVA_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.NX) {
            return NX_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.Sovereign) {
            return SOVEREIGN_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.Sydney) {
            return SYDNEY_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.Brel) {
            return BIRD_OF_PREY_CLASS;
        } else if (spaceframe.id === Spaceframe.D5) {
            return D5_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.D7) {
            return D7_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.D12) {
            return BIRD_OF_PREY_CLASS;
        } else if (spaceframe.id === Spaceframe.KVort) {
            return BIRD_OF_PREY_CLASS;
        } else if (spaceframe.id === Spaceframe.NeghVar) {
            return NEGHVAR_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.Raptor) {
            return RAPTOR_CLASS_OUTLINE;
        } else if (spaceframe.id === Spaceframe.VorCha) {
            return VORCHA_CLASS_OUTLINE;
        } else {
            return null;
        }
    }

    isPreTngEra(serviceYear?: number) {
        return serviceYear && serviceYear < 2320;
    }

    isMovieEra(serviceYear?: number) {
        return serviceYear && serviceYear >= 2270;
    }

    nameIsLike(name: string, comparison: string) {
        if (name) {
            name = name.toUpperCase().replace('-', ' ').trim();
            return name === comparison.toUpperCase() || (name + " CLASS") === comparison.toUpperCase();
        } else {
            return false;
        }
    }

    drawOutline(pdf: PDFDocument, outline: string, options: SheetOutlineOptions) {
        const page = pdf.getPage(0);
        page.moveTo(options.outlineLocation.x, page.getHeight() - options.outlineLocation.y);
        page.drawSvgPath(outline, { borderColor: options.outlineColor, borderWidth: 1.6 / options.outlineScale, scale: PIXELS_TO_POINTS_RATIO * options.outlineScale })
    }
}

export const SpaceframeOutline = new SpaceframeOutlineHelper();